column3:
Объём: 25 л;
Внешний размер: 30х20х45 см;
Время удержания холода: до 82 ч;
Материал:
- высококачественная армированная PVC ткань;
- основное отделение рюкзака из влагоотталкивающего материала PEVA;
- внутреннее отделение с антибактериальным покрытием, препятствующее размножению бактерий и плесени;
Конструктив:
- замок-молния с двойной термо и брызгозащитой;
- внутренний карман для аккумулятора холода, размера 200x100x40 мм;
- два боковых сетчатых кармана для мелких предметов и бутылок;
- открывалка металлическая для бутылок, встроенная в ручку на спине;
- потайной защитный карман для документов или планшета;
- потайной карман на молнии для столовых приборов;
- карман на плечевой лямке для проездных документов из армированного материала, предотвращающего случайные поломки пластиковых карт;
- дополнительный верхний карман с водонепроницаемой застежкой для хранения мелких предметов или документов;
- усиленная анатомическая спинка и плечевые ремни с системой вентиляции AirFlow.
Цвет изделия: Черный Process Black C
Дополнительно: Полоса спереди, Зеленый Pantone 357 C.
Внутри: Салатовый Pantone 361 C.
Брендирование: спереди уф-печать, лого X5 Transport 2+0, 14х4 см. Лого Белый, листочек Зеленый Pantone 361 C;
Упаковка: пластиковый пакет Зеленый 1+0 Pantone 357 C, с лого X5 Transport 2+0, 14х4 см; коробка, картон Черный с печатью лого X5 Transport 2+0, 14х4 см. Лого Белый, листочек Зеленый Pantone 361 C
